	add("allamakee", "{\"term\":\"allamakee\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\", \"Ojibwe\", \"meskwaki\"], \"text\":\"The origin of the name is uncertain, with local lore ascribing it to a Native American trader named Allan Makee\u0026lt;ref\u0026gt;Henry Gannett, in \u0027The origin of certain place names in the United States\u0027, writes \u0026quot;the Iowa Historical Society says it was named for Allen Makee, an Indian trader\u0026quot;\u0026lt;/ref\u0026gt; and other sources suggesting that it derives from an language term for the Thunder clan of the Sac/Fox people; compare Meskwaki \u0027nenemehkiwa\u0027 (thunder) and Ojibwe \u0027animikii\u0027 (thunderer) (alternation of \u0027l\u0027 and \u0027n\u0027 is common in Algonquian languages and in words borrowed into or from them).\u0026lt;ref\u0026gt;William Bright, \u0027Native American Placenames of the United States\u0027\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The northeastern-most county in the state of Iowa in the United States\", \"priority\":1}]}, \"synonyms\":{}}");

