	add("allegiance", "{\"term\":\"allegiance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Proto-Germanic\", \"anglo-norman\"], \"text\":\"From Middle english (1100-1500) \u0027aliegiaunce\u0027 from Anglo-norman \u0027legaunce\u0027 (loyalty of a liege-servant to one\u0027s lord) from Old french (842-ca. 1400) \u0027legeance\u0027 from Old french (842-ca. 1400) \u0027lege\u0027 \u0027liege\u0027 (liege, servant) of Proto-germanic origin. More at {{l|en|liege}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Loyalty to some cause, nation or ruler\", \"priority\":1}]}, \"synonyms\":{}}");

