	add("allele", "{\"term\":\"allele\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"From German \u0027allel\u0027 shortened from \u0027allelomorph\u0027 from English \u0027allelomorph\u0027 Ultimately from the Ancient Greek prefix {{m|grc|ἀλληλ-}} from {{m|grc|ἄλλος||other}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One of a number of alternative forms of the same gene occupying a given position on a chromosome\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dPlant breeding is always a numbers game.The wild species we use are rich in genetic variation, and individual plants are highly heterozygous and do not breed true. In addition, we are looking for rare \u0027\u0027alleles\u0027\u0027, so the more plants we try, the better\", \"priority\":2}]}, \"synonyms\":{}}");

