	add("allergy", "{\"term\":\"allergy\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"ancient greek (to 1453)\"], \"text\":\"From German \u0027allergie\u0027 Coined by Austrian pediatrician w:Clemens von Pirquet|Clemens von Pirquet in 1906 from Ancient greek (to 1453) \u0027ἄλλος\u0027 (other) + \u0027ἔργον\u0027 (work, activity) on the model of \u0027energie\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A disorder of the immune system causing adverse reactions to substances (allergens) not harmful to most and marked by the body\u0027s production of histamines and associated with atopy, anaphylaxis, and asthma\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any condition of hypersensitivity to a substance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Altered susceptibility to a first treatment as exhibited in reaction to a subsequent one\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An antipathy, as toward a person or activity\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He has an \u0027\u0027allergy\u0027\u0027 to reality TV\", \"priority\":5}]}, \"synonyms\":{}}");

