	add("allocution", "{\"term\":\"allocution\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|allocūtiō||address}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A formal speech, especially one which is regarded as authoritative and forceful\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1904\u0027\u0027, Joseph Conrad, \u0027Nostromo\u0027, ch. 2\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Minister of War, in a barrack-square \u0027\u0027allocution\u0027\u0027 to the officers of the artillery regiment he had been inspecting, had declared the national honour sold to foreigners\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The question put to a convicted defendant by a judge after the rendering of the verdict in a trial, in which the defendant is asked whether he or she wishes to make a statement to the court before sentencing; the statement made by a defendant in response to such a question; the legal right of a defendant to make such a statement\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, Caren Myers, \u0026quot;Encouraging \u0027\u0027Allocution\u0027\u0027 at Capital Sentencing: A Proposal for Use Immunity,\u0026quot; \u0027Columbia Law Review\u0027, vol. 97, no. 3, p. 788 n6\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The term \u0026quot;\u0027\u0027allocution\u0027\u0027\u0026quot; refers to the personal right of a defendant to make a statement on his own behalf in an attempt to affect sentencing. . . . The word \u0026quot;\u0027\u0027allocution\u0027\u0027\u0026quot; is also frequently used . . . to describe the statement made by a defendant during a guilty plea proceeding\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The legal right of a victim, in some jurisdictions, to make a statement to a court prior to sentencing of a defendant convicted of a crime causing injury to that victim; the actual statement made to a court by a victim\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1989\u0027\u0027, Karen L. Kennard, \u0026quot;The Victim\u0027s Veto: A Way to Increase Victim Impact on Criminal Case Dispositions,\u0026quot; \u0027California Law Review\u0027, vol. 77, no. 2, p. 427 n49\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"As of July, 1985, 19 states permitted victim \u0027\u0027allocution\u0027\u0027 at the sentencing phase of criminal trials\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A pronouncement by a pope to an assembly of church officials concerning a matter of church policy\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Thomas Shannon and James Walter, \u0026quot;Implications of the Papal \u0027\u0027Allocution\u0027\u0027 on Feeding Tubes,\u0026quot; \u0027The Hastings Center Report\u0027, vol. 34, no. 4, p. 18\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The recent papal \u0027\u0027allocution\u0027\u0027 \u0027To the International Congress on Life-Sustaining Treatment and Vegetative State: Scientific Advances and Ethical Dilemmas\u0027 has been the occasion for much discussion concerning the use of artificial feeding tubes for nutrition and hydration\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The mode of information dissemination in which media broadcasts are transmitted to multiple receivers with no or very limited capability of a two-way exchange of information\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1993\u0027\u0027, I. Th. M. Snellen and Wim B. H. J. van de Donk (eds.), \u0027Public Administration in an Information Age\u0027, ISBN 9789051993950, [http://books.google.ca/books?id\u003dofDFXuBCPcIC\u0026amp;pg\u003dPA198\u0026amp;dq\u003dallocution+-defendant+-law+-papal+-pope+media+-Bordewijk\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d6_NRUvGID4WkqAHK34DYDg\u0026amp;ved\u003d0CEoQuwUwB\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003dallocution%20-defendant%20-law%20-papal%20-pope%20media%20-Bordewijk\u0026amp;f\u003dfalse p. 198 (Google preview\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Allocution\u0027\u0027 is the dissemination of information by a central unit towards a collectivity of decentral units, the central unit being both the source and the determining actor\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Christina Spurgeon, \u0027Advertising and New Media\u0027, ISBN 9780415430357, [http://books.google.ca/books?id\u003dlFiONJ8VvUoC\u0026amp;dq\u003dallocution+-defendant+-law+-papal+-pope+media+Bordewijk\u0026amp;q\u003dallocutio\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"v\u003dsnippet\u0026amp;q\u003dallocution\u0026amp;f\u003dfalse p. 5 (Google preview\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Bordewijk and van Kaam describe the one-to-many architecture of modern broadcast mass media as ‘\u0027\u0027allocution\u0027\u0027’. This is the least responsive type of interactivity because it is not designed to support exchanges. . . . The one-way flow of information is under the programmatic control of the media service provider\", \"priority\":19}]}, \"synonyms\":{}}");

