	add("allopolyploidy", "{\"term\":\"allopolyploidy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of polyploidy (having more than the usual number of chromosomes) that results from the interbreeding of different species\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027 November 23, Zhongfu Ni, \u0027et al.\u0027, “Altered circadian rhythms regulate growth vigour in hybrids and allopolyploids”, \u0027Nature\u0027 Volume 457 No. 7227, doi:10.1038/nature07523\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Several important crops such as wheat, cotton and canola are of \u0027\u0027allopolyploidy\u0027\u0027 that contains two or more divergent genomes, and some plants and animals exist as interspecific hybrids\", \"priority\":3}]}, \"synonyms\":{}}");

