	add("allotheism", "{\"term\":\"allotheism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{prefix|allo|theism|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Worship of a god or gods that are foreign to one\u0027s own land\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1854\u0027\u0027, \u0027The Whole Works of the Right Rev. Jeremy Taylor\u0027, page 436\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I consider that in the first commandment where atheism and polytheism and \u0027\u0027allotheism\u0027\u0027 are forbidden directly and principally\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1864\u0027\u0027, \u0027Critical and Exegetical Commentary on the Book of Genesis\u0027, page 464\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"But we shoud not forget that the world was yet too young to have arrived at the rigid and sharply-defined systems of polytheism or \u0027\u0027allotheism\u0027\u0027 to which we are accustomed\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1879\u0027\u0027, John Heyl Vincent, \u0027The lesson commentary on the International lessons for 1880\u0027, page 164\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The inhabitants, also, of Ur had fallen into polytheism, or, if we may so speak, \u0027\u0027allotheism\u0027\u0027, the worship of other gods\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1984\u0027\u0027, Akbar S. Ahmed, David M. Hart, \u0027Islam in Tribal Societies: From the Atlas to the Indus\u0027, page 8\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"There is no \u0027\u0027allotheism\u0027\u0027 in Islam. Muslims do not anthropomorphise or, conversely, encourage belief in anthropolatry\", \"priority\":9}]}, \"synonyms\":{}}");

	add("allotment", "{\"term\":\"allotment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027alotement\u0027 (French \u0027allotement\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of allotting; assignment\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which is allotted; a share, part, or portion granted or distributed; that which is assigned by lot, or by the act of God; anything set apart for a special use or to a distinct party\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The allowance of a specific amount of scrip or of a particular thing to a particular person.\u0026lt;!-- material copied from Webster\u0027s Revised Unabridged Dictionary (1913) --\u0026gt\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A plot of land rented from the council for growing fruit and vegetables\", \"priority\":4}]}, \"synonyms\":{}}");

