	add("allowance", "{\"term\":\"allowance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"Old french (842-ca. 1400) \u0027alouance\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of allowing, granting, conceding, or admitting; authorization; permission; sanction; tolerance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Without the king\u0027s will or the state\u0027s allowance. --w:William William Shakespear\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Acknowledgment\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The censure of the which one must in your allowance overweigh a whole theater of others. --w:William William Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"That which is allowed; a share or portion allotted or granted; a sum granted as a reimbursement, a bounty, or as appropriate for any purpose; a stated quantity, as of food or drink; hence, a limited quantity of meat and drink, when provisions fall short\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I can give the boy a handsome allowance. -- w:William Makepeace William Makepeace Thackeray\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Abatement; deduction; the taking into account of mitigating circumstances; as, to make allowance for the inexperience of youth\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"After making the largest allowance for fraud. -- w:Thomas Babington Thomas Babington Macaulay\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A customary deduction from the gross weight of goods, different in different countries, such as tare and tret\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A child\u0027s allowance; pocket money\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"She gives her daughters each an \u0027\u0027allowance\u0027\u0027 of thirty dollars a month\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A permissible deviation in the fineness and weight of coins, owing to the difficulty in securing exact conformity to the standard prescribed by law\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"approval; approbatio\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"license; indulgenc\", \"priority\":14}]}, \"synonyms\":{}}");

